An String Array ( StringArray and LargeStringArray ) is used to represent a list of strings stored using the arrow format. A StringArray follows the same idea as a ListArray, the only difference is that the values buffer is made of u8 s that represents the letters or characters. As an example lets create an StringArray that holds the next list: array = ["Hello", "from", null, "Apache", "Arrow"] use arrow::buffer::Buffer;
use arrow::array::{ArrayData, StringArray};
use arrow::datatypes::{DataType, ToByteSlice}; fn main() { // First we define the values that will represent the letters // from the array let values: [u8; 20] = [ b'h', b'e', b'l', b'l', b'o', b'f', b'r', b'o', b'm', b'A', b'p', b'a', b'c', b'h', b'e', b'A', b'r', b'r', b'o', b'w', ]; // And the offset that represents how many characters are in each word let offsets: [i32; 6] = [0, 5, 9, 9, 15, 20]; // By the way, notice the order each buffer is added to the ArrayData. // Each buffer is stored in a vector of buffers, so the only reference // other constructors will have is the vector index. let array_data = ArrayData::builder(DataType::Utf8) .len(5) .add_buffer(Buffer::from(offsets.to_byte_slice())) .add_buffer(Buffer::from(&values[..])) .null_bit_buffer(Buffer::from([0b00011011])) .build(); let string_array = StringArray::from(array_data); println!("{:?}", string_array); println!("Value: {:?}", string_array.value(0)); println!("Value: {:?}", string_array.value(1)); println!("Value: {:?}", string_array.value(2));
} Your output should look similar to this: StringArray [ "hello", "from", null, "Apache", "Arrow", ] Notice how when we print the string array the strings are printed as the should be and not as the u8 values stored in the buffer. This is thanks to the fact that a StringArray "knows" the type of data it holds and thus can represent the strings in the correct way. This can also be seen when the value() method is used on the string. The returned value is the correct representation of the word stored in the array. Tip . From your code remove the null_bit_buffer method from the constructor and see how the empty space is now represented. Using the String builder Similar to the List Array, the construction of a String Array can become a bit complicated if we do it from scratch. You would have to split and put together all the letters from the list and then you would need to create an offset list for the words, plus adding the validity buffer. This would take a lot of time every time a new string array is required. For this reason, the StringBuilder and LargeStringBuilder where created. Lets create a new String Array using an String Builder. use arrow::array::StringBuilder; fn main() { println!("Creating an String Array using builder"); let mut builder = StringBuilder::new(10); builder.append_value("one").unwrap(); builder.append_value("two").unwrap(); builder.append_value("three").unwrap(); builder.append_null().unwrap(); builder.append_value("four").unwrap(); let string_array = builder.finish(); println!("{:?}", string_array);
} As you can see, the creation process is more streamlined an it feels more natural. The builder will append the string and it will create the required buffers automatically.

